import React, { Component } from 'react';
import { Button } from 'semantic-ui-react';

class App extends Component{

    render(){
        return(
            <div style={
                {
                    display: 'flex',  
                    justifyContent:'center', 
                    alignItems:'center', 
                    height: '100vh'
                }
            }>
                <h2>Edu-Ledger</h2>
                <Button primary>Student</Button><br />
                <Button primary>College</Button><br />
                <Button primary>Bank</Button><br />
            </div>
        )
    };
}

export default App;
